    public QbaoUser json2QbaoUser() {
        if (null == user)
            user = gson.fromJson(this.json, QbaoUser.class);
        return user;
    }

    public List<Long> fetchBuyGoodsIds() {
        List<Long> list = new ArrayList<Long>();
        user = json2QbaoUser();
        Goods goods = user.getGoods();
        if (null != goods && CollectionUtils.isNotEmpty(goods.getBuyItems())) {
            List<BuyItem> buyItems = goods.getBuyItems();
            for (BuyItem buy : buyItems) {
                String goodId = buy.getGoodsId();
                if (NumberUtils.isNumber(goodId)) {
                    list.add(Long.valueOf(goodId));
                }
            }
        }
        return list;
    }

